{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/devijeganath/chocolate-bar-rating?scriptVersionId=119661828\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"9163e521","metadata":{"papermill":{"duration":0.009717,"end_time":"2023-02-19T16:24:59.997903","exception":false,"start_time":"2023-02-19T16:24:59.988186","status":"completed"},"tags":[]},"source":[" ðŸ“– **Background**\n"," \n"," You work at a specialty foods import company that wants to expand into gourmet chocolate bars. Your boss needs your team to research this market to inform your initial approach to potential suppliers.\n","\n","After finding valuable chocolate bar ratings online, you need to explore if the chocolate bars with the highest ratings share any characteristics that could help you narrow your search for suppliers (e.g., cacao percentage, bean country of origin, etc.) ðŸ’¾ The data\n","\n","#### Your team created a file with the following information ([source](https://flavorsofcacao.com)):\n","- \"id\" - id number of the review\n","- \"manufacturer\" - Name of the bar manufacturer\n","- \"company_location\" - Location of the manufacturer\n","- \"year_reviewed\" - From 2006 to 2021\n","- \"bean_origin\" - Country of origin of the cacao beans\n","- \"bar_name\" - Name of the chocolate bar\n","- \"cocoa_percent\" - Cocoa content of the bar (%)\n","- \"num_ingredients\" - Number of ingredients\n","- \"ingredients\" - B (Beans), S (Sugar), S* (Sweetener other than sugar or beet sugar), C (Cocoa Butter), (V) Vanilla, (L) Lecithin, (Sa) Salt\n","- \"review\" - Summary of most memorable characteristics of the chocolate bar\n","- \"rating\" - 1.0-1.9 Unpleasant, 2.0-2.9 Disappointing, 3.0-3.49 Recommended, 3.5-3.9 Highly Recommended, 4.0-5.0 Oustanding\n","\n","***Acknowledgments**: Brady Brelinski, Manhattan Chocolate Society*"]},{"cell_type":"code","execution_count":1,"id":"7f914048","metadata":{"execution":{"iopub.execute_input":"2023-02-19T16:25:00.018871Z","iopub.status.busy":"2023-02-19T16:25:00.016249Z","iopub.status.idle":"2023-02-19T16:25:01.632044Z","shell.execute_reply":"2023-02-19T16:25:01.629741Z"},"papermill":{"duration":1.62884,"end_time":"2023-02-19T16:25:01.634752","exception":false,"start_time":"2023-02-19T16:25:00.005912","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["â”€â”€ \u001b[1mAttaching packages\u001b[22m â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ tidyverse 1.3.2 â”€â”€\n","\u001b[32mâœ”\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32mâœ”\u001b[39m \u001b[34mpurrr  \u001b[39m 1.0.1 \n","\u001b[32mâœ”\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32mâœ”\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32mâœ”\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32mâœ”\u001b[39m \u001b[34mstringr\u001b[39m 1.5.0 \n","\u001b[32mâœ”\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32mâœ”\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","â”€â”€ \u001b[1mConflicts\u001b[22m â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€ tidyverse_conflicts() â”€â”€\n","\u001b[31mâœ–\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31mâœ–\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n"]},{"data":{"text/html":["'chocolate-bar-ratings'"],"text/latex":["'chocolate-bar-ratings'"],"text/markdown":["'chocolate-bar-ratings'"],"text/plain":["[1] \"chocolate-bar-ratings\""]},"metadata":{},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n",